import React from 'react';
import Ann_reg_back from '../Ann_Register/Assests/Ann_reg_back.png';
import './ann_register.css'

export default function Ann_Register() {
  return (
    <div className='Ann_reg_first' style={{ backgroundImage: `url(${Ann_reg_back}`,marginTop:"4%"}}>
        <p className='Ann_reg_footer'>"Welcome to Eventease, the premier platform connecting customers with top-rated service providers for all their event planning needs! Whether you're organizing a wedding,<br/> birthday party, corporate event, or any other special occasion, our easy-to-use platform lets you browse and book from a curated selection of vendors who are experts in their field.
</p>

    </div>
  );
}
